import React from 'react'

const navbar = () => {
  const HomeScroll = () =>{
    window.scrollTo({
      top: 200, 
      behavior: 'smooth'
    });
  };
  return (
    <div>
      <div className='navbar'>
        <div onClick={HomeScroll}>Home</div>


      </div>
    </div>
  )
}

export default navbar
